import {NavLink} from 'react-router-dom';

const Menu=()=>
{

    return(
<>
<div className="mainMenu">


<NavLink exact to='/' activeClassName="menu_link"
className="menu_style">Home</NavLink>

<NavLink  to='/about' activeClassName="menu_link" className="menu_style">About</NavLink>

<NavLink exact to='/contact' activeClassName="menu_link" className="menu_style">Contact</NavLink>



</div>

</>
    );
};


export default Menu;
